import React from "react";
import Button from "../components/ui/Button";
import { Link } from "react-router-dom";
import { useTranslation } from "react-i18next";

export default function Home() {
  const { t } = useTranslation();

  return (
    <div className="p-6 space-y-12">
      {/* Hero Section */}
      <section className="text-center py-12 bg-green-50 rounded-xl shadow-md">
        <h2 className="text-4xl font-bold mb-4">{t("home.welcome")}</h2>
        <p className="text-lg max-w-2xl mx-auto mb-6">{t("home.intro")}</p>
        <div className="flex justify-center space-x-4">
          <Link to="/explore">
            <Button>{t("home.ctaExplore")}</Button>
          </Link>
          <Link to="/contact">
            <Button>{t("home.ctaContact")}</Button>
          </Link>
        </div>
      </section>

      {/* Mission Statement */}
      <section className="max-w-4xl mx-auto">
        <h3 className="text-2xl font-semibold mb-3">{t("home.mission")}</h3>
        <p className="text-gray-700 text-lg">{t("home.missionText")}</p>
      </section>
    </div>
  );
}
